import ListItem from "./ListItem";

const ListStoreItems = (props) => {

    return (
                    <table border="1" style={{margin:20}}>
                <thead>
                    <th>#</th>
                    <th>Time</th>
                    <th>Product Name</th>
                    <th>Product Price</th>
                    <th>Delete</th>
                    <th>Edit</th>

                </thead>

                {props.products.map(p => {
                    return <ListItem product={p} />
                })

                }

            </table>
    )
}

export default ListStoreItems;
